  static Future<GoogleGeocoderModel> getRouteFromPositiom({
    @required LatLng origin,
    @required LatLng destination,
    List<LatLng> wayPoint,
    @required String apiKey,
  }) {
    return NetworkUtil()
        .get(GoogleApiEndPointUtil().getDirection(
            origin: "${origin.latitude},${origin.longitude}",
            destination: "${destination.latitude},${destination.longitude}",
            apiKey: apiKey))
        .then((value) {
      return GoogleGeocoderModel.fromJson(json.decode(value));
    }).catchError((onError) {
      throw onError;
    });
  }
